var DEFAULT_TTL_MS = 60 * 60 * 1000;
var MAX_CACHE_ENTRIES = 50;

class AnalysisCache {
  cache = new Map;
  ttlMs;
  constructor(ttlMs = DEFAULT_TTL_MS) {
    this.ttlMs = ttlMs;
  }
  generateKey(source, commitHash) {
    const normalized = source.replace(/\\/g, "/").replace(/\/+$/, "");
    return commitHash ? `${normalized}@${commitHash}` : normalized;
  }
  set(source, data, commitHash, depth = "standard") {
    if (this.cache.size >= MAX_CACHE_ENTRIES) {
      this.evictOldest();
    }
    const key = this.generateKey(source, commitHash);
    const now = Date.now();
    const entry = {
      key,
      value: data,
      createdAt: now,
      expiresAt: now + this.ttlMs,
      metadata: {
        source,
        commitHash,
        depth
      }
    };
    this.cache.set(key, entry);
  }
  get(source, commitHash) {
    const key = this.generateKey(source, commitHash);
    const entry = this.cache.get(key);
    if (!entry) {
      return null;
    }
    if (Date.now() > entry.expiresAt) {
      entry.value.cleanup?.().catch(() => {});
      this.cache.delete(key);
      return null;
    }
    return entry.value;
  }
  getByAnalysisId(analysisId) {
    for (const entry of this.cache.values()) {
      if (entry.value.result.analysisId === analysisId) {
        if (Date.now() > entry.expiresAt) {
          entry.value.cleanup?.().catch(() => {});
          this.cache.delete(entry.key);
          return null;
        }
        return entry.value;
      }
    }
    return null;
  }
  has(source, commitHash) {
    const key = this.generateKey(source, commitHash);
    const entry = this.cache.get(key);
    if (!entry) {
      return false;
    }
    if (Date.now() > entry.expiresAt) {
      this.cache.delete(key);
      return false;
    }
    return true;
  }
  invalidate(source, commitHash) {
    const key = this.generateKey(source, commitHash);
    const entry = this.cache.get(key);
    entry?.value.cleanup?.().catch(() => {});
    return this.cache.delete(key);
  }
  clearExpired() {
    const now = Date.now();
    let cleared = 0;
    for (const [key, entry] of this.cache.entries()) {
      if (now > entry.expiresAt) {
        entry.value.cleanup?.().catch(() => {});
        this.cache.delete(key);
        cleared++;
      }
    }
    return cleared;
  }
  clear() {
    for (const entry of this.cache.values()) {
      entry.value.cleanup?.().catch(() => {});
    }
    this.cache.clear();
  }
  stats() {
    let oldestCreatedAt = null;
    for (const entry of this.cache.values()) {
      if (oldestCreatedAt === null || entry.createdAt < oldestCreatedAt) {
        oldestCreatedAt = entry.createdAt;
      }
    }
    return {
      entries: this.cache.size,
      maxEntries: MAX_CACHE_ENTRIES,
      ttlMs: this.ttlMs,
      oldestEntryAge: oldestCreatedAt ? Date.now() - oldestCreatedAt : null
    };
  }
  evictOldest() {
    let oldestKey = null;
    let oldestTime = Infinity;
    for (const [key, entry] of this.cache.entries()) {
      if (entry.createdAt < oldestTime) {
        oldestTime = entry.createdAt;
        oldestKey = key;
      }
    }
    if (oldestKey) {
      const entry = this.cache.get(oldestKey);
      entry?.value.cleanup?.().catch(() => {});
      this.cache.delete(oldestKey);
    }
  }
}
