import { EventEmitter as EventEmitter2 } from "events";

class Logger extends EventEmitter2 {
  verbose = false;
  quiet = false;
  logs = [];
  currentSpinner = null;
  spinnerFrames = ["", "", "", "", "", "", "", "", "", ""];
  spinnerIndex = 0;
  setVerbose(verbose) {
    this.verbose = verbose;
  }
  setQuiet(quiet) {
    this.quiet = quiet;
  }
  isVerbose() {
    return this.verbose;
  }
  formatDuration(ms) {
    if (ms < 1000)
      return `${ms}ms`;
    return `${(ms / 1000).toFixed(2)}s`;
  }
  writeToStderr(message) {
    if (!this.quiet) {
      if (this.currentSpinner) {
        process.stderr.write("\r\x1B[K");
      }
      process.stderr.write(message + `
`);
      if (this.currentSpinner) {
        this.renderSpinner();
      }
    }
  }
  renderSpinner() {
    if (this.currentSpinner && !this.quiet) {
      const frame = this.spinnerFrames[this.spinnerIndex];
      process.stderr.write(`\r${frame} ${this.currentSpinner.text}`);
    }
  }
  startSpinner(text) {
    if (this.quiet)
      return;
    this.stopSpinner();
    this.currentSpinner = {
      text,
      interval: setInterval(() => {
        this.spinnerIndex = (this.spinnerIndex + 1) % this.spinnerFrames.length;
        this.renderSpinner();
      }, 80)
    };
    this.renderSpinner();
  }
  updateSpinner(text) {
    if (this.currentSpinner) {
      this.currentSpinner.text = text;
      this.renderSpinner();
    }
  }
  stopSpinner(finalMessage) {
    if (this.currentSpinner?.interval) {
      clearInterval(this.currentSpinner.interval);
    }
    if (this.currentSpinner && !this.quiet) {
      process.stderr.write("\r\x1B[K");
      if (finalMessage) {
        process.stderr.write(` ${finalMessage}
`);
      }
    }
    this.currentSpinner = null;
  }
  log(level, phase, message, data) {
    const entry = {
      level,
      phase,
      message,
      data,
      timestamp: new Date
    };
    this.logs.push(entry);
    this.emit("log", entry);
    if (this.verbose || level === "error" || level === "warn") {
      const prefix = this.getPrefix(level, phase);
      const dataStr = data ? ` ${JSON.stringify(data)}` : "";
      this.writeToStderr(`${prefix} ${message}${this.verbose ? dataStr : ""}`);
    }
  }
  getPrefix(level, phase) {
    const colors = {
      debug: "\x1B[90m",
      info: "\x1B[36m",
      warn: "\x1B[33m",
      error: "\x1B[31m",
      progress: "\x1B[35m"
    };
    const reset = "\x1B[0m";
    const color = colors[level];
    const phaseColors = {
      surface: "\x1B[32m",
      structural: "\x1B[34m",
      semantic: "\x1B[35m",
      synthesis: "\x1B[33m",
      orchestrator: "\x1B[36m"
    };
    const phaseColor = phaseColors[phase] || "\x1B[37m";
    return `${color}[${level.toUpperCase()}]${reset} ${phaseColor}[${phase}]${reset}`;
  }
  surface(message, data) {
    this.log("info", "surface", message, data);
  }
  structural(message, data) {
    this.log("info", "structural", message, data);
  }
  semantic(message, data) {
    this.log("info", "semantic", message, data);
  }
  synthesis(message, data) {
    this.log("info", "synthesis", message, data);
  }
  orchestrator(message, data) {
    this.log("info", "orchestrator", message, data);
  }
  progress(phase, message, data) {
    this.log("progress", phase, message, data);
  }
  debug(phase, message, data) {
    if (this.verbose) {
      this.log("debug", phase, message, data);
    }
  }
  warn(phase, message, data) {
    this.log("warn", phase, message, data);
  }
  error(phase, message, data) {
    this.log("error", phase, message, data);
  }
  getLogs() {
    return [...this.logs];
  }
  clearLogs() {
    this.logs = [];
  }
  formatReport() {
    const phases = new Map;
    for (const entry of this.logs) {
      const phaseEntries = phases.get(entry.phase) || [];
      phaseEntries.push(entry);
      phases.set(entry.phase, phaseEntries);
    }
    const lines = [`=== Analysis Log Report ===
`];
    for (const [phase, entries] of phases) {
      lines.push(`
## ${phase.toUpperCase()}`);
      for (const entry of entries) {
        const time3 = entry.timestamp.toISOString().split("T")[1].slice(0, 12);
        lines.push(`  [${time3}] ${entry.level}: ${entry.message}`);
        if (entry.data) {
          lines.push(`           ${JSON.stringify(entry.data)}`);
        }
      }
    }
    return lines.join(`
`);
  }
}
