async function analyzeModulesInParallel(repoPath, modules, state) {
  const results = [];
  const totalBatches = Math.ceil(modules.length / MAX_PARALLEL_STRUCTURAL);
  for (let i2 = 0;i2 < modules.length; i2 += MAX_PARALLEL_STRUCTURAL) {
    const batchNum = Math.floor(i2 / MAX_PARALLEL_STRUCTURAL) + 1;
    const batch = modules.slice(i2, i2 + MAX_PARALLEL_STRUCTURAL);
    logger.debug("structural", `Processing batch ${batchNum}/${totalBatches}`, {
      modules: batch.map((m2) => m2.name)
    });
    logger.updateSpinner(`Structural: batch ${batchNum}/${totalBatches} (${batch.map((m2) => m2.name).join(", ")})`);
    const batchTasks = batch.map((m2) => ({
      id: `structural_${m2.path}`,
      type: "structural",
      target: m2.path,
      status: "pending",
      startTime: Date.now()
    }));
    state.tasks.push(...batchTasks);
    const fileContents = new Map;
    await Promise.all(batch.map(async (module) => {
      const modulePath = join2(repoPath, module.path);
      try {
        const { glob: glob2 } = await Promise.resolve().then(() => (init_esm6(), exports_esm));
        const files = await glob2("**/*", {
          cwd: modulePath,
          nodir: true,
          absolute: false,
          ignore: ["**/node_modules/**", "**/.git/**"]
        });
        for (const file2 of files.slice(0, 50)) {
          const filePath = join2(module.path, file2);
          const fullPath = join2(repoPath, filePath);
          try {
            const content = await readFile2(fullPath, "utf-8");
            if (content.length < 1e5) {
              fileContents.set(filePath, content);
            }
          } catch {}
        }
      } catch {}
    }));
    const batchResults = await analyzeModulesStructurally(batch, repoPath, fileContents);
    for (const task of batchTasks) {
      const result = batchResults.find((r2) => r2.modulePath === task.target);
      if (result) {
        task.status = "completed";
        task.endTime = Date.now();
        task.result = result;
        const duration3 = task.endTime - (task.startTime || task.endTime);
        logger.debug("structural", `Module ${task.target} completed`, {
          functions: result.complexity.functionCount,
          classes: result.complexity.classCount,
          exports: result.exports.length,
          symbols: result.symbols.length,
          durationMs: duration3
        });
      } else {
        task.status = "failed";
        task.endTime = Date.now();
        task.error = "No result returned";
        logger.warn("structural", `Module ${task.target} returned no result`);
      }
    }
    logger.debug("structural", `Batch ${batchNum} complete: ${batchResults.length}/${batch.length} succeeded`);
    results.push(...batchResults);
  }
  return results;
}
